export const Tree = ({ tree }) => {
    console.log(tree)
    return (
        <ul className={`${styles.tree} list-group m-4`} id="tree">
            {tree && tree.map((branch) => (
                <Branch key={branch.category_id} />

            ))}
        </ul>
    )
}
